import { Fragment } from "react";
import ToDoItem from "./ToDoItem";



const todos = [
    
    {
        id: Math.random() + 9,
        activity :"go outside and play"
    
      },

    {
      id: Math.random() + 1,
      activity :"need to go to school"
  
    },
  
    {
      id: Math.random() + 7,
      activity :"Do homework"
  
    }
  ];            
  
const TodoList = () => {

  const Dummy = todos.map((todo) => (
    <ToDoItem key={todo.id} activity={todo.activity} />
  ));

  console.log(Dummy)


  return (
  
      <ul>{Dummy}</ul>
 
  );
};

export default TodoList;
